import React from 'react';

const Info = ({info}) => {

    if(Object.key(info).length === 0) return null;
    
    return ( 
        <div className="card border-light">
            <div className="card-header bg-primary text-light front-weight-bold">
                Informacion artista
            </div>
            <div className="card-body">
                <img src={info.strArtistThumb} alt="Logo Artista"/>
            </div>
        </div>
     );
}
 
export default Info;
